import React from 'react';
import Card from './Card';

const CardList = ({data}) => {

    const deckList = data.map((card, index) => {
        return <Card card={card} key={index}/>
    });


    return(
        <div>
            <ul>
                {data.cards.code}
                {data.cards.suit}
                <img src={data.cards.images.svg}></img>
            </ul>
        </div>
    )
}

export default CardList
